import { Group, Input, FormInputLabel } from "./form-input.style";

const FormInput = ({ label, ...otherprops }) => {
  console.log(otherprops.value.length)
  return (
    <Group>
      <Input {...otherprops} />
      {label && (
        <FormInputLabel shrink={otherprops.value.length}>
          {label}
        </FormInputLabel>
      )}
    </Group>
  );
};
export default FormInput;
